import React from 'react';
import { Link } from 'react-router-dom'; // Import Link for routing
import "./header.css"

const Header = () => {
  return (
    <header className="header">
      {/* Add your logo or website title here */}
      {/* <h1 className="header-title">My Awesome Portfolio</h1>  // Removed */}

      <nav className="navigation"> {/* Add class name for styling */}
        <ul className="navigation-list"> {/* Add class name for styling */}
          <li><Link to="/">Home</Link></li> {/* Link to home page */}
          <li><Link to="/about">About</Link></li> {/* Link to about page */}
          <li><Link to="/contact">Contact</Link></li> {/* Link to contact page */}
        </ul>
      </nav>
    </header>
  );
};

export default Header;
